import React from 'react';
import { DealersTitle } from '../../assets/Json/data';
import { dealers } from '../../assets/Json/data';
import TableBordered from '../../containers/TableBordered/TableBordered';

const Dealers = () => {
  return (
    <>
      <TableBordered Heading='Dealers' Title={DealersTitle} Users={dealers} />
    </>
  );
};

export default Dealers;
